Choose a plugin to use. The below example uses the plugin for pre-commit : {
# ... preCommitConfig = { nixpkgs-fmt = { entry = "${pkgs.nixpkgs-fmt}/bin/nixpkgs-fmt"; language = "system"; files = "\\.nix"; }; }; preCommit = nixago.lib.make { name = "pre-commit"; type = "simple"; configData = preCommitConfig; };
# ...
} The main entry point Nixago provides is via the make function. At the minimum, it needs a plugin name and configuration data for generating the file. Some plugins take an optional type argument that specifies which type of file to generate. In the example above, we opt to use the "simple" type that takes a simplified configuration format for using pre-commit with local commands. For more information, see the pre-commit plugin page. The result from calling make is an attribute set with two entries: configFile, which holds the derivation for generating the file, and shellHook, which contains a shell hook for managing the file. The easiest way to integrate the generated configuration into your development environment is to use the shell hook: {
# ... devShell = pkgs.mkShell { shellHook = preCommit.shellHook; };
# ...
} The hook will automatically link the file from the Nix store to the current working directory. The above example will produce a .pre-commit-config.yaml file with the following contents: repos: - hooks: - entry: /nix/store/pmfl7q4fqqibkfz71lsrkcdi04m0mclf-nixpkgs-fmt-1.2.0/bin/nixpkgs-fmt files: \.nix id: nixpkgs-fmt language: system name: nixpkgs-fmt repo: local Note that using the shell hook is optional. It's possible to use the derivation directly as an output of your flake: {
# ... packages.precommit = preCommit.configFile;
# ...
} You can then build it locally with: nix build #.precommit

