The request module is made up of three submodules: cue, hook, and plugin. The latter is not useful to us when creating custom configurations. The cue submodule provides options for controlling the CUE CLI tool and the hook submodule provides options for controlling the output of the generated shell hook. When creating a custom configuration, only three options are mandatory: configData: The configuration data to be used in generation cue.path: The path where CUE should look for .cue files cue.format: The output format that CUE should produce For our example, we'll specify the following configuration data: { configData = { commit-msg = { scripts = { template_checker = { runner = "bash"; }; }; }; pre-commit = { commands = { stylelint = { tags = "frontend style"; glob = "*.js"; run = "yarn stylelint {staged_files}"; }; rubocop = { tags = "backend style"; glob = "*.rb"; exclude = "application.rb|routes.rb"; run = "bundle exec rubocop --force-exclusion {all_files}"; }; }; scripts = { "good_job.js" = { runner = "node"; }; }; }; };
} The CUE path should point to our templates subdirectory and the output we want is YAML. We will make the generated configuration file an output of our flake so that we can build it: { # ... packages.lefthook = (nixago.lib.makeCustom { inherit configData; cue.path = ./templates; cue.format = "yaml"; }).configFile; # ...
} Now we can build our configuration file: nix build -o lefthook.yml .#lefthook The result should be a lefthook.yml file in our local directory with the following contents: commit-msg: scripts: template_checker: runner: bash
pre-commit: commands: rubocop: exclude: application.rb|routes.rb glob: "*.rb" run: bundle exec rubocop --force-exclusion {all_files} tags: backend style stylelint: glob: "*.js" run: yarn stylelint {staged_files} tags: frontend style scripts: good_job.js: runner: node There are several more options available for controlling the generation process, including configuring a shell hook and passing custom flags to the CUE CLI tool.

