The plugin is first declared in the default.nix: { pkgs, lib }:
{ name = "myPlugin"; # The name of the plugin (should match directory name) types = { # An attribute set of the types of configurations this plugin makes default = { # The default type output = "my_plugin.yaml"; # The default output file make = import ./make_default.nix { inherit pkgs lib; }; # The type func }; anotherType = { # Another type output = "my_plugin.yaml"; make = import ./make_another_type.nix { inherit pkgs lib; }; }; };
} All plugins should receive the { pkgs, lib } set as the first argument. The flake supplies this set, and it contains a copy of nixpkgs and the internal lib set. The function should return a set with the format shown above. Most plugins only have one type (default). However, some tools have multiple files for configuring them, and having the ability to designate various types allows this requirement to be met. For example, the prettier plugin generates both a configuration file and an ignore file. Each type has two attributes: the output defines the default path (relative to the root) of the file that should be generated (the user can override this), and the make defines the function that should be called when this plugin type is executed. We will discuss this function next.

