The next step is creating our function in make_default.nix: { pkgs, lib }:
userData:
with pkgs.lib;
let inherit (userData) configData; lefthook = pkgs.lefthook; # Add an extra hook for adding required stages whenever the file changes skip_attrs = [ "colors" "extends" "skip_output" "source_dir" "source_dir_local" ]; stages = builtins.attrNames (builtins.removeAttrs configData skip_attrs); stagesStr = builtins.concatStringsSep " " stages; shellHookExtra = '' # Install configured hooks for stage in ${stagesStr}; do ${lefthook}/bin/lefthook add -a "$stage" done '';
in
{ inherit shellHookExtra;
} This is where we place the meat of the logic for our plugin. In the above case, we need to perform an extra step when the shell hook activates to ensure that all of the pre-commit stages we defined in the configuration get installed into the local .git/hooks directory. The stages are declared at the root of the configuration, along with some other options. We strip these options to get the stages by themselves and then put them into a space-separated string. The shellHookExtra option allows passing a block of shell code that will be executed whenever the configuration file is updated. Since the user may have added more stages to the configuration file, we add some logic to install all stages whenever the file changes. As noted earlier, we return all of our desired changes in a set. This set will be joined with the one provided by the user to make the final request instance which is used to generate the configuration file.

