Review the CUE section of the design page for more information about CUE. Each type of the plugin typically utilizes a single CUE file, although more advanced cases may require multiple files. When creating the CUE file, keep the following in mind: The schema defined in the file should be sufficient to prevent most configuration mistakes. If the supported tool has rich documentation around valid values for each configuration field, use constraints to improve the accuracy of the schema. Don't be overly strict with the schema definition. The goal is to be helpful and not generate many false negatives. Here is the templates/default.cue file for our plugin: package default #Config: { [string]: #Hook colors?: bool | *true extends?: [...string] skip_output?: [...string] source_dir?: string source_dir_local?: string ...
} #Hook: { commands?: [string]: #Command exclude_tags?: [...string] parallel?: bool | *false piped?: bool | *false scripts?: [string]: #Script ...
} #Command: { exclude?: string files?: string glob?: string root?: string run: string skip?: bool | [...string] tags?: string ...
} #Script: { runner: string ...
} { #Config
} This file defines four definitions , denoted by the # symbol. A definition is synonymous with a schema or contract. It describes the shape of valid data through various constraints. Let's break one down: #Config: { [string]: #Hook colors?: bool | *true extends?: [...string] skip_output?: [...string] source_dir?: string source_dir_local?: string
} Each definition typically encompasses a single layer of the configuration file. The #Config definition encompasses the top layer. The top layer contains global options which change the behavior of the tool (i.e., source_dir) and a map of stage names to their respective hook definition ([string]: #Hook). The ? at the end of the names denotes that they are optional. Definitions can reference other definitions, as seen by the [string]: #Hook line. This says that the data must contain a string name that has a body that is compatible with the #Hook definition. { #Config
} This final bit is where we define the elements of the CUE file. This is what will appear when we evaluate the CUE file. In the above case, we're saying the input data should be a struct that conforms to the schema defined by #Config. We're doing no additional transformations to the incoming data in this case. We expect the input data to be in the format defined in the lefthook.yml file. Since YAML is a superset of JSON, we can easily ask CUE to evaluate the input and produce a YAML output.

